import axios from "axios";
import { useEffect } from "react";
import { useState } from "react";
import { Link } from "react-router-dom";

const MovieList = ()=>{
    // const [movie,setmovie]=useState([])
    // const [loading,setloading]=useState(false)

    useEffect(()=>{
        const data = axios.get('ttps://www.omdbapi.com/?i=tt3896198&apikey=8a7484af')
        data.then((res)=>{
            console.log(res)
        }).catch((err)=>{
            alert(err.message)
        })  
        
      },[])
    return <div>
    <h1>The MovieList Page</h1>
    <ul >
        {/* <li><Link  to='/movies/p1'> A Book</Link></li>
        <li><Link  to='/movies/p2'>A Carpet</Link></li>
        <li><Link  to='/movies/p3'>A online Course</Link></li> */}
    </ul>
    </div>
}

export default MovieList;
